import { Link, useLocation } from "react-router-dom";
import {FaUser, FaCalendar, FaClock, FaEnvelope, FaBook, FaUserFriends, FaInfoCircle}
    from "react-icons/fa";

function KanbasNavigation() {
    const links = ["Account", "Dashboard", "Courses", "Inbox", "Groups", "Calendar", "Help"];
    const icons = [FaUser(undefined), FaClock(), FaBook(), FaEnvelope(), FaUserFriends(), FaCalendar(),
    FaInfoCircle()]
    const { pathname } = useLocation();
    return (
        <div className="list-group" style={{ width: 150 }}>
            {links.map((link, index) => (
                <Link
                    key={index}
                    to={`/Kanbas/${link}`}
                    className={`list-group-item ${pathname.includes(link) && "active"}`}>
                    {link} {icons[index]}
                </Link>
            ))}
            {icons.map((icon_name, index) => (
                <Link
                    key={index}
                    to={`/Kanbas/${icon_name}`}
                    className={`list-group-item ${pathname.includes(icon_name) && "active"}`}>
                    {icon_name}
                </Link>
            ))}
        </div>
    );
}
export default KanbasNavigation;
